INSERT INTO `products` (`id`, `product_name`, `description`, `amount_product`, `point_product`, `quantity_product`, `del_flag`, `status`, `category_id`, `created_date`, `updated_date`) VALUES
(1, 'Redme Galaxy S20 FE (8GB/256GB)', '<p>Samsung đã giới thiệu đến người dùng thành viên mới của dòng điện thoại thông minh S20 Series đó chính là Samsung Galaxy S20 FE. Đây là mẫu flagship cao cấp quy tụ nhiều tính năng mà Samfan yêu thích, hứa hẹn sẽ mang lại trải nghiệm cao cấp của dòng Galaxy S với mức giá dễ tiếp cận hơn.</p>\r\n', 2000, 2, 0, 1, 1, 1, '2021-09-22 03:10:03', '2021-09-22 03:10:03'),
(13, 'Redme 13ProMax (16GB/ 256GB)', '<p>&nbsp;</p>\r\n\r\n<p>Galaxy Z Fold3 5G, chiếc điện thoại đượchhh nâ&nbsp;cấp toàn diện về nhiều mặt, đặc biệt đây là điện thoại màn hình gập đầu</p>\r\n', 2000, 3, 449, 1, 1, 1, '2021-09-22 03:10:03', '2021-09-22 03:10:03'),
(14, 'Samsung Galaxy A22 (8GB/266GB)', '<p>Samsung chào đón mùa hè 2021 bằng sự ra mắt của bộ đôi Galaxy A22 và Galaxy A22 5G với nhiều thông số ấn tượng. Trong đó, Galaxy A22 sở hữu viên pin đầy năng suất, hiệu năng gaming mạnh mẽ và màn hình lớn có khả năng hiển thị tốt.</p>\r\n', 2000, 5, 0, 1, 1, 1, '2021-09-22 03:10:03', '2021-09-22 03:10:03'),
(15, 'Samsung Galaxy Z Fold2 5G', '<p>Galaxy Z Fold 2 là tên gọi chính thức của điện thoại màn hình gập cao cấp của Samsung. Với nhiều nâng cấp tiên phong về thiết kế, hiệu năng và camera, hứa hẹn đây sẽ là một siêu phẩm thành công tiếp theo đến từ &ldquo;ông trùm&rdquo; sản xuất điện thoại lớn nhất thế giới.</p>\r\n', 2002, 8, 0, 1, 1, 1, '2021-09-22 03:10:03', '2021-09-22 03:10:03'),
(16, 'Samsung Galaxy S21 Ultra 5G 128GB  ', '<p>Sự đẳng cấp được Samsung gửi gắm thông qua chiếc smartphone Galaxy S21 Ultra 5G với hàng loạt sự nâng cấp và cải tiến không chỉ ngoại hình bên ngoài mà còn sức mạnh bên trong, hứa hẹn đáp ứng trọn vẹn nhu cầu ngày càng cao của người dùng.</p>\r\n', 2002, 0, 0, 1, 1, 1, '2021-09-22 03:10:03', '2021-09-22 03:10:03'),
(17, 'OPPO Reno6 Z 5G ', 'Reno6 Z 5G đến từ nhà OPPO với hàng loạt sự nâng cấp và cải tiến không chỉ ngoại hình bên ngoài mà còn sức mạnh bên trong. Đặc biệt, chiếc điện thoại được hãng đánh giá “chuyên gia chân dung bắt trọn mọi cảm xúc chân thật nhất”, đây chắc chắn sẽ là một “siêu phẩm\" mà bạn không thể bỏ qua.', 200, 0, 12122279, 0, 1, 2, '2021-09-22 03:10:03', '2021-09-22 03:10:03'),
(18, 'OPPO A74', '<p>OPPO luôn đa dạng hoá các sản phẩm của mình từ giá rẻ cho đến cao cấp. Trong đó, điện thoại OPPO A74 4G được nằm trong phân khúc tầm trung rất đáng chú ý với nhiều tính năng và smartphone cũng chính là bản nâng cấp của OPPO A73 ra mắt trước đó.</p>\r\n', 200, 0, 2746, 0, 1, 2, '2021-09-22 03:10:03', '2021-09-22 03:10:03'),
(19, 'OPPO Reno6 5G', 'Reno6 Z 5G đến từ nhà OPPO với hàng loạt sự nâng cấp và cải tiến không chỉ ngoại hình bên ngoài mà còn sức mạnh bên trong. Đặc biệt, chiếc điện thoại được hãng đánh giá “chuyên gia chân dung bắt trọn mọi cảm xúc chân thật nhất”, đây chắc chắn sẽ là một “siêu phẩm\" mà bạn không thể bỏ qua.', 200, 0, 0, 1, 1, 2, '2021-09-22 03:10:03', '2021-09-22 03:10:03'),
