(80, 'Điện thoại OPPO A74 (12GB/126GB)', '<h3>Thiết kế quen thuộc, màu sắc tối giản</h3>\r\n\r\n<p>Chiếc điện thoại OPPO A74 vẫn sở hữu cụm camera nằm trong mô-đun hình chữ nhật góc trái thân thuộc của hãng, máy được gia công tỉ mỉ, tối ưu kích thước giúp smartphone mỏng nhẹ, thiết kế thân máy cong 3D mảnh mai, dễ cầm nắm sử dụng.</p>\r\n', 9000, 120, 427, 0, 1, 2, '2021-10-15 04:56:23', '2021-10-15 04:56:23'),
(81, 'Điện thoại Oppo A94 (12GB/126GB)', '<h3>Thiết kế quen thuộc, màu sắc tối giản</h3>\r\n\r\n<p>Chiếc điện thoại OPPO A94 vẫn sở hữu cụm camera nằm trong mô-đun hình chữ nhật góc trái thân thuộc của hãng, máy được gia công tỉ mỉ, tối ưu kích thước giúp smartphone mỏng nhẹ, thiết kế thân máy cong 3D mảnh mai, dễ cầm nắm sử dụng.</p>\r\n', 2002, 50, 0, 1, 1, 2, '2021-10-15 05:03:39', '2021-10-15 05:03:39'),
