(88, 'Điện thoại Xiaomi 11T 5G 256GB', '<h3>Bài viết đánh giá</h3>\r\n\r\n<h3><a href=\"https://www.thegioididong.com/dtdd/xiaomi-11t-256gb\" target=\"_blank\">Xiaomi 11T 5G</a>&nbsp;sở hữu màn hình AMOLED, viên pin siêu khủng cùng camera độ phân giải 108 MP, chiếc&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">smartphone</a>&nbsp;này của&nbsp;<a href=\"https://www.thegioididong.com/dtdd-xiaomi\" target=\"_blank\">Xiaomi</a>&nbsp;sẽ đáp ứng mọi nhu cầu sử dụng của bạn, từ giải trí đến làm việc đều vô cùng mượt mà.&nbsp;</h3>\r\n\r\n<h3>Cho ra những tác phẩm đầy chân thật với camera 108 MP</h3>\r\n\r\n<p>Xiaomi đã trang bị cho máy cụm 3 camera sau gồm camera chính 108 MP, camera góc rộng có độ phân giải 8 MP cùng camera telemacro 5 MP kết hợp cùng phần cứng bên trong cho khả năng lấy nét, thu sáng và zoom cực tốt để cho ra những bức ảnh chi tiết dù bạn chụp gần hay chụp xa.&nbsp;</p>\r\n', 9000, 50, 541, 0, 1, 5, '2021-11-01 02:33:28', '2021-11-01 02:33:28'),
(89, 'Điện thoại Vsmart Joy 4 (6GB/64GB)', '<h3>Bài viết đánh giá</h3>\r\n\r\n<h3><a href=\"https://www.thegioididong.com/dtdd/vsmart-joy-4-6gb\" target=\"_blank\">Vsmart Joy 4</a>, một sản phẩm đáng tự hào được sản xuất từ thương hiệu Việt&nbsp;<a href=\"https://www.thegioididong.com/dtdd-vsmart\" target=\"_blank\">Vsmart</a>&nbsp;với nhiều tính năng nổi bật từ hiệu năng mạnh mẽ, cụm 4 camera đa tính năng cho đến pin khủng 5000 mAh, hứa hẹn sẽ được nhiều người dùng săn đón.</h3>\r\n\r\n<h3>Thiết kế sang trọng, bắt mắt</h3>\r\n\r\n<p>Vsmart Joy 4 cải tiến vượt bậc về ngoại hình với phần lưng được làm nhám nên rất ít bám vân tay, kèm với những tông màu trẻ trung cho hiệu ứng chuyển màu gradient khi nghiêng máy ở các góc khác nhau.</p>', 9000, 12, 480, 0, 1, 43, '2021-11-01 02:35:14', '2021-11-01 02:35:14'),
(90, 'Điện thoại Xiaomi Mi 11 5G', '<h3><a href=\"https://www.thegioididong.com/dtdd/xiaomi-mi-11\" target=\"_blank\">Xiaomi Mi 11</a>&nbsp;một siêu phẩm đến từ&nbsp;<a href=\"https://www.thegioididong.com/dtdd-xiaomi\" target=\"_blank\">Xiaomi</a>, máy cho trải nghiệm hiệu năng hàng đầu với vi xử lý Qualcomm Snapdragon 888, cùng loạt công nghệ đỉnh cao, khiến bất kỳ ai cũng sẽ choáng ngợp về&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">smartphone</a>&nbsp;này.</h3>\r\n\r\n<h3>Thiết kế nổi bật với cụm camera độc nhất</h3>\r\n\r\n<p>Có thể thấy, điểm sáng trong thiết kế của Mi 11 đến từ cụm 3 camera mặt sau được đặt trong mô-đun hình vuông, được phân tầng với 2 lớp kính tạo nên sự khác biệt và nổi bật ngay từ cái nhìn đầu tiên.</p>', 9000, 50, 538, 0, 1, 5, '2021-11-02 09:58:27', '2021-11-02 09:58:27'),
(91, 'Điện thoại Vsmart Joy 3 (4GB/640GB)', '<h3><a href=\"https://www.thegioididong.com/dtdd/vsmart-joy-3-4gb\" target=\"_blank\">Vsmart Joy 3 4GB/64GB</a>&nbsp;là một phiên bản được nâng cấp nhẹ về RAM và bộ nhớ trong so với 2 mẫu smartphone cùng tên trước đó, mang đến thêm một sự lựa chọn hấp dẫn ở phân khúc&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">smartphone giá rẻ</a>&nbsp;cho người dùng.</h3>\r\n\r\n<h3>Cấu hình nâng cấp với mức giá bình dân</h3>\r\n\r\n<p>Không vì mức giá rẻ mà cấu hình bị thua thiệt, Joy 3 bản 4 GB vẫn được&nbsp;<a href=\"https://www.thegioididong.com/dtdd-vsmart\" target=\"_blank\">hãng Vsmart</a>&nbsp;tích hợp vi xử lý tầm trung Snapdragon 632 cho hiệu năng xử lý mượt các tác vụ hàng ngày cũng như giúp&nbsp;<a href=\"https://www.thegioididong.com/dtdd-choi-game\" target=\"_blank\">điện thoại chơi game</a>&nbsp;tốt, ổn định trên các tựa game hot nhất hiện nay như Liên Quân hay PUBG Mobile ở mức đồ họa trung bình.&nbsp;</p>\r\n', 9000, 50, 404, 0, 1, 43, '2021-11-02 09:59:37', '2021-11-02 09:59:37'),
